import './Chat.css';


const Chat = ({location}) => {
    useEffect(() => {
        const {name, room} = queryString.parse(location.search);
        console.log(name);
        console.log(room);
    });

    return(
        <h1>Chat</h1>
    )
}

export default Chat;
